    marginBottom: "25px",
    position: "relative",
    fontFamily: 'Merriweather, serif , Open Sans Condensed , sans-serif',
    fontFamily: '',

    textAlign: "center"
  }

const NavigationBottom = (props) => {
  return (
  <div style={box}>
   <Container>
    <Row>
      <Col xs={12} sm={12} md={12} lg={4}>
         <br/>
         <img src={require(`../assets/logo adirasa.png`)} height="90px" alt="" />
         <CardTitle>Adirasa Snack</CardTitle>
      </Col>
      <Col xs={12} sm={12} md={12} lg={4}>
         <br/>
