      </Col>
      <Col xs={12} sm={12} md={12} lg={4}>
         <br/>
         <CardTitle>Toko Offline Retail Kami</CardTitle>
         <p> Mall Bassura City ( Lantai 1 )</p>
         <p> Cityplaza Jatinegara ( Lantai 1 ) </p>
      </Col>
    </Row>
  </Container>
  </div>
  );
};

export default NavigationBottom ;
